INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_foodDescription`, `field_foodPrice`, `field_basicText`, `field_specialDescription`, `field_specialLightSwitch`, `field_email`, `field_hours`, `field_phoneNumber`, `field_reservationInfo`, `field_privateParty`, `field_teamMemberBio`, `field_aboutForHomepage`, `field_currentLightswitch`, `field_interactiveMap`, `field_headerTitle1`, `field_headerTitle2`, `field_headerTitle3`, `field_eventDate`, `field_copyRightText`, `field_parkingInformation`, `field_parkingInformation2`, `field_parkingInformation3`, `field_valetPrice`, `field_valetInformation`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-01-24 03:51:10', '2017-01-24 04:36:12', '4d1265f1-bff7-4bc4-ae0a-230b85924c15'),
 ('2', '2', 'en_us', 'Home', '<p>Treno Ristorante, an upscale Italian restaurant, will be located in the historical train depot overlooking the Cuyahoga River in Downtown Kent, Ohio. Formerly the Pufferbelly Restaurant, the depot is currently undergoing a transformative renovation of its space, and the restaurant will be opening this summer 2017.</p>\n<p>Treno will lend a cultural charm where patrons will feel included and part of the dining experience. With a menu focused on Northern Italian cuisine, our dishes will be prepared in house from scratch with fresh, flavorful ingredients including locally sourced products as available. We invite you to enjoy a memorable evening out or delicious lunch featuring exquisitely-prepared authentic Italian fare complemented by a thoughtful wine list and full bar selection.</p>', NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, 'Welcome', 'to Kents', 'Ristorante', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-01-24 03:51:11', '2017-09-22 14:51:58', '0f06c49f-ff28-4cd1-ab90-c62ed1e135f3'),
 ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Trenokent.com. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p>\n<!--pagebreak-->\n<p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p>\n<p>Craft: a nice alternative to Word, if you’re making a website.</p>\n<p>Hi</p>', NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, NULL, NULL, '2017-05-11 04:00:00', NULL, NULL, NULL, NULL, NULL, NULL, '2017-01-24 03:51:11', '2017-03-14 16:28:13', 'f67afbf8-d052-4de3-bf09-1c81b41420a0'),
 ('5', '5', 'en_us', 'Appetizer', NULL, NULL, '0.00', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-01-24 15:31:16', '2017-01-24 15:31:16', '2f6defa7-8e1b-4355-b7ce-0ee2cbbfd367'),
 ('6', '6', 'en_us', 'Steak', NULL, 'Description of the Food', '20.00', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-01-24 15:33:41', '2017-02-07 15:06:23', '092670ab-38c8-4a78-80f6-d08fd2c0fe10'),
