 ('8', '8', 'en_us', 'About Treno', '<p>Treno is a new website that is opening in Kent Ohio in May of 2017</p>', NULL, '0.00', 'History', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '<p>Treno Ristorante, an upscale Italian restaurant, will be located in the historical train depot overlooking the Cuyahoga River in Downtown Kent, Ohio. Formerly the Pufferbelly Restaurant, the depot is currently undergoing a transformative renovation of its space, and the restaurant will be opening this summer 2017.</p>\n<p><br />Treno will lend a cultural charm where patrons will feel included and part of the dining experience. With a menu focused on Northern Italian cuisine, our dishes will be prepared in house from scratch with fresh, flavorful ingredients including locally sourced products as available. We invite you to enjoy a memorable evening out or delicious lunch featuring exquisitely-prepared authentic Italian fare complemented by a thoughtful wine list and full bar selection.</p>', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-01-24 16:04:19', '2017-07-10 19:03:34', '1dca425a-653f-4118-b2f6-0c6f43b586a7'),
